    false,nt"url": null,nt"notes": "The Hawaii Coastal Use Mapping Project
    is an innovative partnership between NOAA's National Marine Protected Areas Center,
    NOAA's Pacific Islands Fisheries Science Center, NOAA's Pacific Islands Regional
    Office, and the Hawaii Division of Aquatic Resources. The project was designed to
    enhance ocean management by gathering geospatial data on human uses of the nearshore
    ocean environment in the Kawaihae-Keahole region of Hawaii. The data were collected
    from regional ocean experts and users through participatory GIS methods. For more
    information on the project scope, background and related data products, please visit
    http://www.mpa.gov/dataanalysis/hi_coastal_use/. The West Maui Coastal use Participatory
    Mapping Project was developed through a partnership between the Hawaii State Division
    of Aquatic Resources (HDAR), NOAA's Pacific Islands Regional Office (PIRO), NOAA
    Coral Reef Conservation Program (CRCP) and NOAA's Ocean Service, Office for Coastal
    Management - Pacific Islands (OCM). The project was designed to enhance ocean management
    by gathering geospatial data on human uses of the nearshore ocean environment in
    the Honolua-Wahikuli region of Hawaii. The data were collected from regional ocean
    experts and users through participatory GIS methods. For more information on the
    project scope, background and related data products, please visit http://www.hawaiicoralreefstrategy.com/index.php/prioritysites/westmaui/.",nt"license_title":
